@catalinmpit Love this Catalin. For anyone feeling imposter syndrome, two important realizations I had about sharing online:

- At first, very few people are watching. No reason to be afraid.
- The more you share, the more you learn, the faster you become an expert.

@marktenenholtz Love this and experienced it myself at first. You can get lost at sea forever in that ocean. 

In my opinion, step 1 doesn't even need to include any stats or ML.

A DSA course in Python + consistent pandas practice is plenty to get started.

@Jeande_d I think there are layers to this.

Currently experiencing some frustration with the rigidity of MLStudio's UI-centric platform. But also understand the inefficiencies of cloning from notebooks and scripts.

There's a happy medium somewhere in code-centric flexible automation.
